    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  return (
    <div>
      <Header course={course}/>
      <Content part1={part1.name} exercises1={part1.exercises} exercises2={part1.exercises} exercises3={part1.exercises} part2={part2.name} part3={part3.name}/>
      <Total exercises1={part1.exercises} exercises2={part1.exercises} exercises3={part1.exercises}/>
    </div>
  )
}

export default App
